import { Card } from 'antd';
const { Meta } = Card;


function PlacesSummary({ placesdata }) {
    console.log(placesdata);
    return placesdata.map(places => {
        return (
            <Card
                hoverable={true}
                cover={<img src={places.picture} />}>
                <Meta
                    title={places.name}
                    description={places.description}
                />
            </Card>)
    });
}

export default PlacesSummary;
